"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"medical medical_review\" href=\"UTD.htm?5/23/5497?source=related_link\">",
"      Left ventricular thrombus after acute myocardial infarction",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"medical medical_review\" href=\"UTD.htm?11/57/12186?source=related_link\">",
"      Severe extremity injury in the adult patient",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"medical medical_review\" href=\"UTD.htm?25/7/25721?source=related_link\">",
"      The role of the vulnerable plaque in acute coronary syndromes",
"     </a>",
"    </li>",
