var title_f13_3_13372="Viral skin infections after OLT";
var content_f13_3_13372=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=GAST%2F76657&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=GAST%2F76657&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Viral skin infections after liver transplantation",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td class=\"subtitle1\">",
"       Virus",
"      </td>",
"      <td class=\"subtitle1\">",
"       Comments",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Cytomegalovirus",
"      </td>",
"      <td>",
"       Uncommon, indicates strong immunosuppression. Mucocutaneous lesions are polymorphic: vesicles, necrotic lesions, oral or genital ulcerations.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Epstein Barr virus",
"      </td>",
"      <td>",
"       Responsible for oral hairy leukoplakia. Sign of a strong immunosuppression.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Herpes simplex",
"      </td>",
"      <td>",
"       Frequent. Reactivation can occur in the days following the transplantation or years later. Sometimes unusual presentations: skin necrosis, ulceration, pseudo-tumoral vegetations. Primary infection via the graft is possible.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Herpes zoster",
"      </td>",
"      <td>",
"       Reactivation can occur in about 20 percent of the patients with a liver graft. Necrotic or hemorrhagic pustules that can be limited to a dermatome or have a generalized distribution. Should be considered as a threatening complication. Can trigger many unexpected complications such as pancreatitis. Like generalized shingles, varicella is a dermatologic emergency given the risk of visceral dissemination: meningoencephalitis, fulminant pneumopathy, and diffuse intravascular coagulopathy.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Molluscum contagiosum",
"      </td>",
"      <td>",
"       Due to a poxvirus infection. Multiple and often large lesions found on the scalp, beard, axillae, and groin. Biopsies are necessary to differentiate them from verrucae, sebaceous hyperplasia, and cryptococcosis.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Papillomavirus",
"      </td>",
"      <td>",
"       Verrucea appear 2 to 3 years after the transplantation and continue to grow and multiply over the years. More than 80 percent of the recipients of a liver graft have verrucea vulgaris or genital warts 5 years after transplantation. They are particularly frequent in patients with a strong immunosuppression. Papillomavirus lesions in the anogenital region increase the risk of a squamous cell carcinoma by a factor of 100. In this transplant context the type of papillomaviruses lose their tissue specificity. Papillomaviruses type 6 and 11 have been found in verrucae vulgaris. Conversion to sirolimus may be a useful strategy for recalcitrant cutaneous viral warts [1].",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     1. Dharancy, S, Catteau, B, Mortier, L, et al. Conversion to sirolimus: a useful strategy for recalcitrant cutaneous viral warts in liver transplant recipient. Liver Transpl 2006; 12:1883.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
